import { IonLabel, IonSegment, IonTitle, IonToolbar } from "@ionic/react";
import { useState } from "react";
import Layout from "../../components/Layout/Layout"

const Gastos: React.FC = () => { 
    const [selected, onSelected] = useState(0);

    const onchange = (event:any) => { 
            console.log(event.detail);            
    }

    return <Layout name='Gastos'>
        <IonSegment disabled={selected != 0} value='0' onIonChange={onchange}><IonLabel>Tipo</IonLabel></IonSegment>
        <IonSegment disabled={ selected!=1}  value='1' onIonChange={onchange}><IonLabel>Descripcion</IonLabel></IonSegment>
        <IonSegment disabled={ selected!=2}  value='2' onIonChange={onchange}><IonLabel>Comprobante</IonLabel></IonSegment>
        <IonSegment disabled={ selected!=3}  value='3' onIonChange={onchange}><IonLabel>Resumen</IonLabel></IonSegment>
    </Layout>
}

export default Gastos;
